import React from 'react';
import './index.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";



function Navigation() {
  return (

    <Router>
        <div> 
          <nav>
        <ul>
     <li>
       <Link to="/">Home</Link>
     </li>
     <li>
       <Link to="/">Home</Link>
     </li>
     <li>
       <Link to="/">Home</Link>
     </li>
        </ul>
          </nav>
        </div>
    </Router>
  );
}

export default Navigation;
